import { Routes, Route } from 'react-router-dom'
// import Home from './routes/Home'
import Navbar from './components/hero/Navbar';
function App() {
  return (
    <Routes>
      <Route path='/' element={<Navbar />}>
        <Route path='/hero' element={<Hero />}/>
      </Route>
    </Routes>
  );
}

export default App;
